import React, {useState} from 'react'

const [Search, setSearch] = useState('');
export default function Searche() {

    const onSearches = event => {setSearch(event.target.value)}



    return (
        <div>
            <input type="text" placeholder="Search here!" onChange={onSearches}></input>        
        </div>
    )
}

export function filtered(paran){
    paran.filter(results => {return(results.name.includes(Search))});
}
